import { CommonModule } from '@angular/common';
import { Component } from '@angular/core';
import { IonicModule, ModalController } from '@ionic/angular';

import { PetPage } from '../pet/pet.page';
import { Pet, PetSpecies } from '../../types/types';
import { AddPetPage } from '../add-pet/add-pet.page';

import { v4 as uuidv4 } from 'uuid';

@Component({
  selector: 'app-pets',
  templateUrl: 'pets.page.html',
  styleUrls: ['pets.page.scss'],
  standalone: true,
  imports: [IonicModule, CommonModule],
})
export class PetsPage {
  myPets: Pet[];

  constructor(private modalCtrl: ModalController) {
    this.myPets = [
      {
        uuid: uuidv4(),
        name: 'Emil',
        species: PetSpecies.CAT,
        foods: [{ uuid: uuidv4(), name: 'Royal Canin Gastro' }],
        medicines: [
          {
            uuid: uuidv4(),
            name: 'Herztablette 1',
            dosage: '1/4 Tablette',
            frequencies: [{ time: { hour: 17, minute: 30 }, everyDays: 1 }],
          },
          {
            uuid: uuidv4(),
            name: 'Herztablette 2',
            dosage: '1/4 Tablette',
            frequencies: [{ time: { hour: 17, minute: 30 }, everyDays: 1 }],
          },
        ],
        vetAppointments: [{ uuid: uuidv4(), name: 'Herzultraschall' }],
        image:
          'data:image/jpeg;base64,',
      },
      {
        uuid: uuidv4(),
        name: 'Pius',
        species: PetSpecies.CAT,
        foods: [{ uuid: uuidv4(), name: 'Royal Canin Diabetic' }],
        medicines: [
          {
            uuid: uuidv4(),
            name: 'Insulin',
            dosage: '1,5 Einheiten',
            frequencies: [
              { time: { hour: 7, minute: 0 }, everyDays: 1 },
              { time: { hour: 19, minute: 0 }, everyDays: 1 },
            ],
          },
        ],
        vetAppointments: [],
        image:
          'data:image/jpeg;base64,',
      },
    ];
  }

  async openPetModal(pet: Pet) {
    console.log('opening page for ' + pet.name);

    const modal = await this.modalCtrl.create({
      component: PetPage,
      componentProps: { pet },
    });
    modal.present();

    const { data, role } = await modal.onWillDismiss();
  }

  async addPet() {
    console.log('opening new pet modal');

    const modal = await this.modalCtrl.create({
      component: AddPetPage,
    });
    modal.present();

    const { data, role } = await modal.onWillDismiss();

    if (role !== 'cancel') {
      this.myPets.push(data);
    }
  }
}
